import React from "react";
import styles from "../../styles/communitypage.module.scss";
import post from "./Post";
import {Posts} from "../../interface/posts";

const Item = ({ title, date, time, location, participants, description } : Posts ) => {
    return (
        <div className={styles.postItem}>
            <h2>{title}</h2>
            <p>날짜: {date}</p>
            <p>시간: {time}</p>
            <p>장소: {location}</p>
            <p>인원: {participants}</p>
            <p>{description}</p>
        </div>
    );
};

export default Item;
